const Country = (props) => {

    return(
        <>
        {console.log(props)}
        <h2>props.country: {props.country.name.common}</h2>
        <p>Capital: {props.country.capital}</p>
        <p>Area: {props.country.area}</p>
        <h2>languages:</h2>
        <ul>
            {props.country.languages 
            ? Object.values(props.country.languages).map(i => <li>{i}</li>)
            : null}
        </ul> 
        <div alt='flag'>{props.country.flag}</div>
        </>
    )
}
export default Country
